import React from 'react';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Profile  from './Profile';
import PatientTransaction  from './PatientTransaction';
import PatientHealth  from './PatientHealth';
import PatientActivity  from './PatientActivity';
import Provideroverview  from './Provideroverview';



const TapProvider = () => {
  
  const [value, setValue] = React.useState(2);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    < >
       <Tabs
                  value={value}
                  indicatorColor="primary"
                  textColor="primary"
                  onChange={handleChange}
                  className='labeling'
                  aria-label="disabled tabs example"
                >
                  <Tab label="Overview"  onClick={Provideroverview}/>
                  <Tab label="Review" onClick={Providereview} />
                  <Tab label="Bank Details" onClick={PatientHealth}/>
                  <Tab label="Transaction" onClick={PatientHealth}/>
                  <Tab label="Activity Log"onClick={PatientActivity} />

                </Tabs>

          {value === 0 && <Provideroverview/>}
          {value === 1 && <PatientTransaction/>}
          {value === 2 && <PatientHealth/>}
          {value === 3 && <PatientActivity/>}


     
    </>
  );
};

export default TapProvider;
